	public static  String main (double _numero, String _moneda)  {
		
		//double _numero=21023.33;
		double _fraccion;
		String _cadena="";
		double _miles=0;
		double _millones=0;
		
		
		llena_numeros();


 		if(_numero>=1000000) {
 			_millones=_numero/1000000;
 			int _millones_int = (int)_millones;
 			_cadena=_cadena+misNumeros[_millones_int]+" MILLONES ";
 			_numero=_numero-(_millones_int*1000000);
 			
 					
 			
 		} 

		
		
 		if(_numero>=1000) {
 			_miles=_numero/1000;
 			int _miles_int = (int)_miles;
 			_cadena=_cadena+misNumeros[_miles_int]+" MIL ";
 			_numero=_numero-(_miles_int*1000);
 			
 					
 			
 		} 
 		
 		
 		
		Integer _entero = (int)_numero;
		_fraccion=round(_numero-_entero,2)*100;
		//_fraccion=round(_fraccion,0);
		Integer _fraccion_int = (int)_fraccion;
		
		
		
		
		if(_numero<1000) {
			_cadena=_cadena+misNumeros[_entero];
		}
		
		//_fraccion=_fraccion*100;
		if(_fraccion==0) {	
			_cadena=_cadena+" CON 00/100";
			} else {
				
				if(_fraccion<=9) {
					_cadena=_cadena+" CON 0"+_fraccion_int+"/100";
				} else {
					_cadena=_cadena+" CON "+_fraccion_int+"/100";
				}
				
			}
		
				
		return _cadena+" "+_moneda;
		
		
	}
	
	
	public static double round(double value, int places) {
	    if (places < 0) throw new IllegalArgumentException();

	    long factor = (long) Math.pow(10, places);
	    value = value * factor;
	    long tmp = Math.round(value);
	    return (double) tmp / factor;
	}
	
	
